(function($){
	function menuUtil(ele, options) {
		this.targetDiv = ele;
		this.params = $.extend({}, $.fn.defaults, options);
		this.initTempHtml();
		this.loadData();
		this.bindEvents();
	};
	
	menuUtil.prototype = {
		menuWrapperTemplate : "<dl class='menu-c@{i}'><dt>@{appName}</dt></dl>",
		menuIconTemplate : "<dd><a href='javascript:void(0);' type='@{appType}' url='@{url}' appid='@{appid}' menuid='@{id}' action='/menuCtr/getMenuUrlFromThirdParty'><span class='menuUtil-icon-@{alias}'></span>@{name}</a></dd>",
		menuNoIconTemplate : "<dd><a href='javascript:void(0);' type='@{appType}' url='@{url}' appid='@{appid}' menuid='@{id}'>@{name}</a></dd>",
		menuObj : {
			menuWrapper : {
				tempHTMLArr : [],
				tempValues: []
			},
			iconMenu : {
				tempHTMLArr : [],
				tempValues: []
			},
			noIconMenu : {
				tempHTMLArr : [],
				tempValues: []
			}
		},
		dealTemplateHtml : function(type, tempHtml){
			var reg = new RegExp("\\@\\{(\\w+?)\\}", "g"),
				tempHtmlArr = [],
				tempValues = [],
				prevIndex = 0;
		
			while ((result = reg.exec(tempHtml)) != null) 
			{
				tempValues.push(result[0].substring(2, result[0].length - 1).toLocaleLowerCase());
				tempHtmlArr.push(tempHtml.substring(prevIndex, result.index));
				prevIndex = reg.lastIndex;
			}
			tempHtmlArr.push(tempHtml.substring(prevIndex, tempHtml.length));
			this.menuObj[type]["tempHTMLArr"] = tempHtmlArr;
			this.menuObj[type]["tempValues"] = tempValues;
		},
		initTempHtml: function(){
			this.dealTemplateHtml("menuWrapper", this.menuWrapperTemplate);
			this.dealTemplateHtml("iconMenu", this.menuIconTemplate);
			this.dealTemplateHtml("noIconMenu", this.menuNoIconTemplate);
		},
		loadData: function(){
			var dc = new BSPUtil.DataCollection(),
				_this = this;
			
			dc.add("userName", _this.params.userName);
			dc.add(BSPUtil.Constant.action, _this.targetDiv.attr("action"));
			
			$.vmsAjax({dc: dc, ContextPath: _this.params.contextPath ? _this.params.contextPath : $.vmsAjax.defaults.ContextPath}, function(response){
			/*$.ajax({
				url: 'http://localhost:8080/bsp/StaticResources/ModuleRs/UserIndex/menus_0.json',
				cache: false,
				success: function(data) {
					if (data) {*/
					if (response.get("Status") == 0)
					{
						_this.targetDiv.html("<p style='text-align:center;color:red;'>请求数据异常，请检查网络或者用户是否登录</p>");
						
						return;
					}
					_this.dealData(response);
					if (typeof _this.params.callback == 'function') {
						_this.params.callback();
						_this.params.callback = null;
					}
			});
				
			//});
		},
		dealData: function(data){
			if (data && data instanceof BSPUtil.DataCollection) {
				var json = eval('(' + data.get(BSPUtil.Constant.bspData) + ')');
				
				this.render(json.data);
			}
		},
		render: function(data){
			var _this = this,
			    _target = _this.targetDiv,
			    _afterEle = _target.find("#retBtn");
			
			if (data && data.length > 0) {
				var _wrapper = $("<div/>")
							.addClass("menuUtil-list"),
					menuWrapperObj = _this.menuObj["menuWrapper"],
					menuWrappedObj = (_this.params.hasIcon == true) 
							? _this.menuObj["iconMenu"]
							: _this.menuObj["noIconMenu"],
					wrapperTempHTMLArr = menuWrapperObj.tempHTMLArr,
					wrapperTempValues = menuWrapperObj.tempValues,
					wrappedTempHTMLArr = menuWrappedObj.tempHTMLArr,
					wrappedTempValues = menuWrappedObj.tempValues;
				
				_target.find("div.menuUtil-list").remove();			
				$.each(data, function(i, item){
					item.i = i + 1;
					 
					var jWrapper = $(_this.getParsedHtml(item, 
							wrapperTempHTMLArr, wrapperTempValues)),
						wrapperCloneObj = _wrapper.clone();
					
					$.each(item.items, function(j, menu) {
						var jWrapped = $(_this.getParsedHtml(menu, 
								wrappedTempHTMLArr, wrappedTempValues));
						
						jWrapper.append(jWrapped);
					});
					jWrapper.appendTo(wrapperCloneObj);
					wrapperCloneObj.insertBefore(_afterEle);
				});
				if (_this.params.isShow == true) {
					_target.slideToggle("fast");
				}
				_target.find("a[appid="+_this.params.appid+"][menuid="+_this.params.menuid+"]").addClass("menu-chosen");
			}
		},
		getParsedHtml: function(item, tempHTMLArr, tempValues) {
			var tempHTML = [];
			
			for ( var i = 0; i < tempHTMLArr.length; i++) {
				tempHTML.push(tempHTMLArr[i]);
				if (i < tempValues.length) {
					if(!item[tempValues[i]]){
						tempHTML.push("");
					} else{
						tempHTML.push(item[tempValues[i]]);
					}
				}
			}
			
			return tempHTML.join("");
		},
		bindEvents: function(){
			var $this = this;
			this.targetDiv.on("click", "div.menuUtil-list dd a", function(e) {
		    	 e.stopPropagation();
		    	 var _this = $(this),
		    	 	type = _this.attr("type");
		    	 
		    	 if (0 == type) {
		    		 var basePath = $this.params.contextPath ? $this.params.contextPath : $.vmsAjax.defaults.ContextPath,
		    			      url = basePath + _this.attr("url");
		    		 	
		    		 window.location = url;
		    	 } else if (1 == type){
		    		 var appid = _this.attr("appid"),
		    		 	menuid = _this.attr("menuid"),
		    		 	action = _this.attr("action"),
		    		 	dc = new BSPUtil.DataCollection();
		    		 dc.add("appid", appid);
		    		 dc.add("menuid", menuid);
		    		 dc.add(BSPUtil.Constant.action, action);
		    		 $.vmsAjax({dc: dc, callBack: 'menuUrlCallBack', ContextPath: $this.params.contextPath ? $this.params.contextPath : $.vmsAjax.defaults.ContextPath}, function(response){
		    			 var url = response.get(BSPUtil.Constant.bspData);
		    			 
		    			 window.location = url;
		    		 });
		    	}
		    }); 
		}
	};
	
	$.fn.bspMenu = function(option, callback) {
		var args = arguments;
		return this.each(function () {
		      var $this = $(this)
		        , data = $this.data('bspmenu')
		        , options = typeof option == 'object' && option
		        , callBack = (typeof args[0] == 'function') ? args[0] : callback;
		      
		      if (!data) {
		    	  $this.data('bspmenu', (data = new menuUtil($this, options || {callback: callBack}))); 
		      } 
		      window[$this.attr("id")] = data;
		});
	};
	
	$.fn.defaults = {
			hasIcon: true,
			isShow: false
	};
	
	$.bspMenuPlugin = function(option, callback) {
		$.bspMenuPlugin.initHtml(option, callback);
	};
	$.extend($.bspMenuPlugin, {
		initHtml: function(option, callback) {
			var _menuWrapper = $("<div/>")
					.attr("id", "menuWrapper")
					.addClass("menu-wrapper")
					.appendTo($(document.body))
					.extend({
						_header: this.initHeader(option),
						_body: this.initBody(option)
					});
			
			_menuWrapper.append(_menuWrapper._header);
			_menuWrapper.append(_menuWrapper._body);
			_menuWrapper.find("#menuBody").bspMenu(option, callback);
		},
		initHeader: function(option) {
			var _header = $("<div/>")
					.addClass("global-nav")
					.attr("id", "menuHeader"),
				_logo = $("<div/>")
					.addClass("logo")
					.html("<a href='javascript:void(0);'><div class='bsp-logo' ></div></a>")
					.appendTo(_header),
				_channelName = $("<h2/>")
					.addClass("channel-name")
					.html(option.appName ? option.appName : "新媒体BSP管理中心")
					.appendTo(_header),
				_usr_wrap = $("<div/>")
					.addClass("usr-center-wrap")
					.html("<div class='usr-center'>"
						+ " <span class='usr-img'><img src='http://113.142.30.108:8080/bsp/StaticResources/GlobalRs/images/usr-img.jpg' width='25' height='25' alt=''></span>"
						+ " <span class='usr-name'>"+(option.userName ? option.userName : "")+"</span></div>"
						+ " <div class='usr-service'>"
						+ " <ul>"
					//	+ " <li class='usr-exit'><a id='logout' href='javascript:void(0);' action='"+option.contextPath+"/Login/logoutFromThirdParty' class='u6'>退出</a></li>"
						+ " <li class='usr-exit'><a id='logout' href='"+option.contextPath+"/Login.jsp'  class='u6'>退出</a></li>"
						+ " </ul></div>")
					.appendTo(_header)
					.on("click", "#logout", function(){
						var _this = $(this),
							action = _this.attr("action"),
							dc = new BSPUtil.DataCollection();
						
						dc.add("userName", option.userName);
						dc.add(BSPUtil.Constant.action, action);
						$.vmsAjax({dc: dc, callBack: 'logoutCallBack', ContextPath: option.contextPath ? option.contextPath : $.vmsAjax.defaults.ContextPath}, function(response){
							if (response.get("Status") == 1) {
								var data = response.get(BSPUtil.Constant.bspData);
								
								window.location = data;
							}
						});
					}),
				_retUi = $("<div style='width:24px;height:24px;' class='addMenuUtil-btn' ></div>")
					.appendTo(_header)
					.on("click", function(){
						$("#menuBody").slideToggle("fast");
						/*window.location = (option.contextPath ? option.contextPath : $.vmsAjax.defaults.ContextPath) 
									+ "/UserIndex/UserIndex.jsp?uid=" + option.userID;*/
					});
			
			
			return _header;
		},
		initBody: function(option) {
			var _body = $("<div/>")
					.addClass("bsp-menuUtil")
					.attr("id", "menuBody")
					.attr("action", "/privilege/getMenuPrivs")
					.html("<img alt='' class='line'/><div id='retBtn'><a href='javascript:void(0);' id='retBSP'>返回BSP运营中心</a></div>")
					.on("click", "#retBSP ", function(){
						window.location = (option.contextPath ? option.contextPath : $.vmsAjax.defaults.ContextPath) 
								+ "/UserIndex/UserIndex.jsp?userName=" + option.userName;
					})
					.css("display", "none");
			
			return _body;
		}
	});
})(window.$S);
